    "An Evaluation of Ecosystem Restoration and Management Options for Seedskadee National
    Wildlife Refuge",nt"tracking_summary": {ntt"total": 8,ntt"recent":
    0nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T22:46:20.849740",nt"name": "an-evaluation-of-ecosystem-restoration-and-management-options-for-seedskadee-national-wild",nt"isopen":
    false,nt"url": null,nt"notes": "This Evaluation of Ecosystem Restoration
    and Management Options covers the hydrogeomorphic analysis (HGM) for the Seedskadee
    National Wildlife Refuge (NWR). This three step process outlines the historical
    landscape, contemporary changes from pre-settlement conditions, restoration and
    management options and monitoring and evaluation needs within wetland, riverine,
    and upland areas on the refuge. Topics include geomorphology, soils, topography/elevation,
    climate and hydrology. This report provides a hydrogeomorphic (HGM) evaluation of
    ecosystem restoration and management options for the Seedskadee National Wildlife
    Refuge (NWR). Objectives of the report are:1. Describe the pre-European settlement
    (hereafter Pre-settlement) ecosystem condition and ecological processes occurring
    near and including the wetland and riverine habitats along the Green River in Sweetwater
    County, Wyoming. 2. Document changes in the regional ecosystem from the Pre-settlement
    period with specific reference to alterations in hydrology, vegetation community
    structure and distribution, and resource availability to key fish and wildlife species.3.
    Identify restoration and management options incorporating ecological attributes
    needed to restore specific habitats and conditions within Seedskadee NWR.",nt"license_title":
